import './userList.css';
import { DataGrid } from '@mui/x-data-grid';
import { DeleteOutline } from "@material-ui/icons";

export default function UserList() {

  const columns  = [
    { field: 'id', headerName: 'ID', width: 90 },
    { field: 'user', headerName: 'Full Name', width: 130, renderCell: (params) => {
      return (
        <div className="userListUser">
          <img className="userListImg" src={params.row.avatar} alt="" />
          {params.row.username}
        </div>
      )
    }
},
    { field: 'age', headerName: 'Age', type: 'number', width: 100,},
    { field: 'email', headerName: 'Email', width: 150 },
    { field: 'address', headerName: 'Home Address', width: 150 },
    { field: 'transaction', headerName: 'Transaction Value', width: 160 },
    { field: 'status', headerName: 'Status', width: 160 },
    {
      field: "action",
      headerName: "Action",
      width: 150,
      renderCell: (params) => {
        return (
          <>
            <Link to={"/user/" + params.row.id}>
              <button className="userListEdit">Edit</button>
            </Link>
            <DeleteOutline
              className="userListDelete"
              onClick={() => handleDelete(params.row.id)}
            />
          </>
        );
      },
    },
  ];
  
  const rows = [
    { id: 1, username: "Job Snow", avatar:"https://www.dotafire.com/images/hero/icon/meepo.png", email:"asdasd@gmail.com", age: 32, address:"asdasdasdas", status:"active", 
    transaction:"300"},
    { id: 2, username: "Job Snow", avatar:"https://www.dotafire.com/images/hero/icon/meepo.png", email:"asdasd@gmail.com", age: 32, address:"asdasdasdas", status:"active", 
    transaction:"300"},
    { id: 3, username: "Job Snow", avatar:"https://www.dotafire.com/images/hero/icon/meepo.png", email:"asdasd@gmail.com", age: 32, address:"asdasdasdas", status:"active", 
    transaction:"300"},
    { id: 4, username: "Job Snow", avatar:"https://www.dotafire.com/images/hero/icon/meepo.png", email:"asdasd@gmail.com", age: 32, address:"asdasdasdas", status:"active", 
    transaction:"300"},
    
    
  ];


  return (
    <div className="userList">
      <DataGrid rows={rows} disableSelectionOnClick columns={columns} pageSize={10} rowsPerPageOptions={[5]} checkboxSelection />
    </div>
  )
}
